import React, { Component } from "react";
import "./App.css";
import Navbar from "../Navbar/Navbar";
import Landing from "../Landing/Landing";

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="navbarMain">
          <Navbar />
        </header>
        <div className="App-div">
          <Landing />
        </div>
      </div>
    );
  }
}

export default App;
